import { useDispatch, useSelector } from 'react-redux'

export default function useGetKnightMoves() {
	const { gameField } = useSelector((store) => store.chess)

	return (x,y)=>{}

	const moves = [
		[x + 2, y - 1],
		[x + 2, y + 1],
		[x - 2, y + 1],
		[x - 2, y - 1],
		[x + 1, y + 2],
		[x - 1, y + 2],
		[x + 1, y - 2],
		[x - 1, y - 2],
	]
	return moves
}
